import React from 'react'

function KAPSE(props){
  console.log(props);
  return(
    <h1>{props.name} hello</h1>
  )
}

function REST(props){
  console.log(props);
  return(
    <>
    <img src='/assets/food.jpg' alt="restaurant pic" />
    <ul>
      {props.plate.map((val,idx)=>
        (<li key={idx}>{val}</li>)
      )}
    </ul>
    </>
  )
}

const DISHES=[
  "biryani",
  "breakfase",
  "mutton"
]

const App = () => {
  return (
    <React.Fragment>
      <KAPSE name="anil"/>
      <REST plate={DISHES}/>
    </React.Fragment>
  )
}

export default App
